import React from "react";
import './Expenses.css';
import ExpenseItem from './ExpenseItem';

function Expenses  (props){
    return (
        <div className = "expenses">

            {
                props.item.map(
                    expense => {
                        <ExpenseItem
                        date={expense.date}  // passing the data as a variable
                        title={expense.title}
                        amount={expense.amount}/>
        
                    }
                )
            }
            
     
            <ExpenseItem
                date={props.item[1].date}  // passing the data as a variable
                title={props.item[1].title}
                amount={props.item[1].amount}/>

     
            <ExpenseItem
                date={props.item[2].date}  // passing the data as a variable
                title={props.item[2].title}
                amount={props.item[2].amount}/>

          
            <ExpenseItem
                date={props.item[3].date}  // passing the data as a variable
                title={props.item[3].title}
                amount={props.item[3].amount}/>

        
            <ExpenseItem
                date={props.item[4].date}  // passing the data as a variable
                title={props.item[4].title}
                amount={props.item[4].amount}/>
          
        </div>
    )
}
export default Expenses;
